BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "DrawDotData" (
	"id"	INTEGER,
	"stage_id"	INTEGER,
	"order"	INTEGER,
	"x"	REAL,
	"y"	REAL
);
CREATE TABLE IF NOT EXISTS "StageData" (
	"id"	INTEGER,
	"picture_name"	TEXT
);
CREATE TABLE IF NOT EXISTS "LocalizedSQLData" (
	"id"	TEXT,
	"english"	TEXT,
	"vietnamese"	TEXT,
	"arabic"	TEXT,
	"dutch"	TEXT,
	"french"	TEXT,
	"german"	TEXT,
	"japanese"	TEXT,
	"korean"	TEXT,
	"portuguese"	TEXT,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "PictureData" (
	"id"	INTEGER,
	"name"	TEXT,
	"bound_x"	REAL,
	"bound_y"	REAL,
	"bound_width"	REAL,
	"bound_height"	REAL,
	"score_required"	REAL,
	"bound_angle_z"	REAL,
	"use_v4"	INTEGER,
	PRIMARY KEY("name")
);
COMMIT;
