INSERT INTO "LocalizedSQLData" VALUES ('noti_remindplay_2_title','Oh no!','Bạn có thông minh như bạn nghĩ?','أوه لا!','Oh nee!','Oh non!','Ach nein!','あらいやだ！','오 안돼!','Ah não!'),
 ('noti_remindplay_2_message','You dropped a drawn part here','Chỉ người thông minh mới tìm ra điều còn thiếu','لقد أسقطت جزءًا مرسومًا هنا','U liet een getrokken deel hier','Vous avez laissé tomber une partie dessinée ici','Sie haben hier ein gezeichnetes Teil abgelegt','あなたはここに描かれた部分を落としました','여기에 그려진 부분을 떨어 뜨 렸습니다.','Você deixou cair uma parte desenhada aqui'),
 ('noti_remindplay_4_title','Missing you!','Nhớ bạn ghê á!','افتقدتك!','Het missen van u!','Vous me manquez!','Verfehlung Sie!','あなたが恋しい！','네가 그리워!','Saudades de você!'),
 ('noti_remindplay_4_message','These pictures are missing one part of you ','Những hình vẽ này đang nhớ "một phần" của bạn đấy','هذه الصور تفتقد إلى جزء منك','Deze foto''s missen een deel van jou','Ces images manquent une partie de vous','Diese Bilder fehlen ein Teil von dir','これらの写真にはあなたの一部が欠けています','이 사진들은 당신의 한 부분을 놓치고 있습니다','Estas fotos estão faltando uma parte de você'),
 ('noti_remindplay_6_title','My dear,','Bạn thân mến!','عزيزتي','Mijn beste,','Mon cher,','Mein lieber,','親愛なる君へ、','내 사랑,','Meu querido,'),
 ('noti_remindplay_6_message','May I have just one line from you?','Có thể cho mình xin một nét vẽ được không?','هل لي بسطر واحد منك؟','Mag ik één regel van u hebben?','Puis-je avoir juste une ligne de vous?','Darf ich nur eine Zeile von Ihnen haben?','私はあなたからわずか1行を有することができますか？','한 줄만 주 시겠어요?','Posso ter apenas uma linha de você?');
